a = str(input("Enter Number 1: "))
b = str(input("Enter Number 2: "))
t1 = a[::-1]
t2 = b[::-1]

num1 = [int(item) for item in t1]
num2 = [int(item) for item in t2]
res_matrix = []
max_ele_count = len(num1) + 1 + (len(num2) - 1)
res_arr = []
# print(num1, num2, max_ele_count)

for (index, item) in enumerate(num2):
    carry_i = 0
    tmp_res = deque()
    for _ in range(index):
        tmp_res.append(0)
    for (_, n) in enumerate(num1):
        prod = item * n
        result = (prod + carry_i) % 10
        carry = (prod + carry_i) // 10
        tmp_res.appendleft(result)
        carry_i = carry
    if carry_i > 0:
        tmp_res.appendleft(carry_i)
        carry_i = 0
    for _ in range(max_ele_count - len(tmp_res)):
        tmp_res.appendleft(0)
    res_matrix.append(list(tmp_res))
    # print(res_matrix)

carry_i = 0
for i in range(len(res_matrix[0]) - 1, -1, -1):
    sum = 0
    for j in range(len(res_matrix) - 1, -1, -1):
        sum += res_matrix[j][i]
    # print(sum)
    result = (sum + carry_i) % 10
    carry = (sum + carry_i) // 10
    res_arr.append(str(result))
    carry_i = carry

if carry_i > 0:
    res_arr.append(str(result))
    carry_i = 0

if res_arr[-1] == '0':
    res_arr.pop()

res_arr = res_arr[::-1]
print("result: ", "".join(res_arr))


        

